import React from 'react'
import Item from './Item'
import store from '../state/store';

const List = () => {
   const {data} = store();

   if(!data.length) return <>loading ... </>

   return (
      <ul>
         {
            data.map((obj)=><Item/>)
         }
      </ul>
   )
}

export default List
